import React from "react";
import ListItem from "./ListItem";

function Gryffindor({id, name, handleRemove}){

  console.log("(G) Students: ", name)
  const displayStudents = name.map((names, id) => {
    return <ListItem 
      key={id}
      id={id+1}
      student_name={names}
    />
    }
  )

  return(
    <div>
      <header>
        Gryffindor Students
      </header>
      {<ListItem 
      key={id}
      student_name={displayNames}
      onRemove={handleRemove}
      /> }
    </div>
  )
}

export default Gryffindor;
